import React, { useState, useEffect } from "react";
import { APIProvider, Map } from '@vis.gl/react-google-maps';
import { Link } from "react-router-dom";
import logo from './logo.png'; 

const position = { lat: 6.8214925581511565, lng: 80.04122509763354 };

const Dashboard = () => {
    const [height, setHeight] = useState(0); // Height state

    useEffect(() => {
        const column2 = document.getElementById('column_two');
        if (column2) {
            setHeight(column2.offsetHeight);
        }
    }, []);

    return (
        <APIProvider apiKey={"YOUR_API_KEY"}>
            <>
                <nav>
                    <div className="logo">
                        <img src={logo} alt="Logo" width="100" height="100" />
                    </div>
                    <Link to="/Home" title="Home"><b>Home</b></Link>
                    <Link to="/Dashboard" title="Dashboard"><b>Dashboard</b></Link>
                    <Link to="/Profile" title="Profile"><b>Profile</b></Link>
                    <Link to="/Reservations" title="Reservations"><b>Reservations</b></Link>
                </nav>

                <div className="container">
                    <article className="main-content">
                        <div className="content-wrapper">
                            <h1 className="section-title">Accommodations</h1>
                            <div className="map-container" style={{ height: `calc(100vh - ${height}px)` }}>
                                <Map defaultCenter={position} defaultZoom={12}></Map>
                            </div>
                        </div>
                    </article>
                </div>

                <footer className="footer">
                    <small className="copyright">Â© Created by Group CC, All Rights Reserved.</small>
                </footer>
            </>
        </APIProvider>
    );
}

export default Dashboard;
